function drawChart(element, data, chartType) {
  var commitCountsMap = new Map();

  for (const commit of reposData['commits']) {
    const author = commit['author'];
    if (!commitCountsMap.has(author)) {
      commitCountsMap.set(author, 0);
    }
    commitCountsMap.set(author, commitCountsMap.get(author) + 1);
  }

  // Sort the commit counts map by number of commits
  commitCountsMap = new Map(Array.from(commitCountsMap.entries()).sort((a, b) => b[1] - a[1]));

  let plotlyData, layout;
  switch (chartType) {
    case 'pie-chart-commits-by-author':
      plotlyData = [
        {
          values: Array.from(commitCountsMap.values()),
          labels: Array.from(commitCountsMap.keys()),
          type: 'pie',
          //maybe for loop for the firs 3??
          textinfo: "percentage",
          showlegend: false,
          hoverinfo: 'percent+label',
          //domain: {y: [0, 0]}
        }
        ];

        layout = {
        height: 450,
        width: 600,

      }


break;
    case 'bar-chart-code-lines-per-file':
      plotlyData = [
        {
          y: Array.from(commitCountsMap.values()),
          x: Array.from(commitCountsMap.keys()),
          type: 'bar',
          marker: {color: 'rgba(5,112,1,0.65)'},

        }
      ];
      layout = {
        xaxis: {title: {text: 'Files'}},
        yaxis: {title: {text: 'Lines of code'}},
        barcornerradius: 7,

      };

  }

  Plotly.newPlot(element.querySelector('.plotly-graph'), plotlyData,layout);

  const mostCommitsTable = element.querySelector('.most-table');
  const leastCommitsTable = element.querySelector('.least-table');

  const highestCommitters = Array.from(commitCountsMap.entries()).slice(0, 3);
  const lowestCommitters = Array.from(commitCountsMap.entries()).slice(Math.max(commitCountsMap.size - 3, 0)).reverse();

  var i = 0;

  for (const [author, commitCount] of highestCommitters) {
    const row = document.createElement('tr');
    mostCommitsTable.appendChild(row);
    const rankCell = document.createElement('td');
    rankCell.class = 'td';
    rankCell.textContent = `${i + 1}`;
    row.appendChild(rankCell);
    const authorCell = document.createElement('td');
    authorCell.class = 'td';
    authorCell.textContent = `${author} (${commitCount} commits)`
    row.appendChild(authorCell);

    i++;
  }

  i = commitCountsMap.size;

  for (const [author, commitCount] of lowestCommitters) {
    const row = document.createElement('tr');
    leastCommitsTable.appendChild(row);
    const rankCell = document.createElement('td');
    rankCell.class = 'td';
    rankCell.textContent = `${i}`;
    row.appendChild(rankCell);
    const authorCell = document.createElement('td');
    authorCell.class = 'td';
    authorCell.textContent = `${author} (${commitCount} commits)`
    row.appendChild(authorCell);

    i--;
  }
}

drawChart(document.querySelector('.commits-per-author-container'), reposData, 'pie-chart-commits-by-author');
drawChart(document.querySelector('.code-lines-in-files-per-project-container'), reposData, 'bar-chart-code-lines-per-file');